    of environmentally sensitive areas (ESA) in EPA Region I. ESAs were developed as
    part of an EPA headquarters initiative based on reviews of various regulatory and
    guidance documents, as well as phone interviews with federal/state/local government
    agencies and private organizations. ESAs include, but are not limited to, wetlands,
    biological resources, habitats, national parks, archaeological/historic sites, natural
